package exercise12;

public class Example <T>{
	private T first;
	private T second;

	public Example() {
		this.first = first;
		this.second = second;
		// TODO Auto-generated constructor stub
	}
	
	public Example(T first, T second) {
		super();
		this.first = first;
		this.second = second;
	}

	public T getFirst() {
		return first;
	}

	public void setFirst(T first) {
		this.first = first;
	}

	public T getSecond() {
		return second;
	}

	public void setSecond(T second) {
		this.second = second;
	}
	

}
